import React, {Component} from 'react';
import {connect} from "react-redux";
import EnhancedForm from "./EnhancedForm";

import {makeRequest} from "../../../store/ducks/suggest-form/operations";
import {clearForm} from "../../../store/ducks/suggest-form/actions";


class SuggestFormContainer extends Component {

    handleBack() {
        this.props.history.goBack()
    }

    render() {
        const {suggestForm, makeRequest} = this.props

        return (
            <EnhancedForm
                handleBack={this.handleBack.bind(this)}
                makeRequest={makeRequest}
            />
        );
    }
}

const mapStateToProps = (state) => ({
    suggestForm: state.suggestForm
})

export default connect(mapStateToProps, {clearForm, makeRequest})(SuggestFormContainer)
